import test from 'node:test';
import assert from 'node:assert/strict';
import { createServer } from 'node:http';
import { EventEmitter } from 'node:events';
import { io as clientIo, type Socket as ClientSocket } from 'socket.io-client';

import { WebSocketGateway } from '../lib/game-engine/WebSocketGateway';
import { WS_EVENTS } from '../lib/game-engine/constants';

class FakePriceService extends EventEmitter {
  async start(): Promise<void> {}
  async stop(): Promise<void> {}
}

type FakeGameState = {
  roundId: string;
  status: string;
  asset: string;
  startPrice: number;
  currentPrice: number;
  currentRow: number;
  elapsed: number;
  roundStartTime: number;
};

class FakeGameEngine extends EventEmitter {
  public placeBetCalls: Array<{ userId: string; request: any }> = [];

  constructor(
    private state: FakeGameState | null,
    private config: { asset: string; bettingDuration: number; maxDuration: number }
  ) {
    super();
  }

  getState(): any {
    return this.state;
  }

  getConfig(): any {
    return this.config;
  }

  async placeBet(userId: string, request: any): Promise<void> {
    this.placeBetCalls.push({ userId, request });
    this.emit('bet:confirmed', {
      userId,
      orderId: request.orderId,
      betId: `bet-${request.orderId}`,
      multiplier: 1.2345,
      targetRow: request.targetRow,
      targetTime: request.targetTime,
      amount: request.amount,
    });
  }

  async stop(): Promise<void> {}
}

function waitForEvent<T = any>(socket: ClientSocket, event: string, timeoutMs = 2000): Promise<T> {
  return new Promise((resolve, reject) => {
    const timeout = setTimeout(() => {
      reject(new Error(`Timeout waiting for event: ${event}`));
    }, timeoutMs);

    socket.once(event, (payload: T) => {
      clearTimeout(timeout);
      resolve(payload);
    });
  });
}

function waitForEventWhere<T = any>(
  socket: ClientSocket,
  event: string,
  predicate: (payload: T) => boolean,
  timeoutMs = 2000
): Promise<T> {
  return new Promise((resolve, reject) => {
    const timeout = setTimeout(() => {
      cleanup();
      reject(new Error(`Timeout waiting for event: ${event} (predicate)`));
    }, timeoutMs);

    const handler = (payload: T) => {
      if (!predicate(payload)) return;
      cleanup();
      resolve(payload);
    };

    const cleanup = () => {
      clearTimeout(timeout);
      socket.off(event, handler);
    };

    socket.on(event, handler);
  });
}

async function waitUntil(fn: () => boolean, timeoutMs = 2000): Promise<void> {
  const start = Date.now();
  while (!fn()) {
    if (Date.now() - start > timeoutMs) {
      throw new Error('Timeout waiting for condition');
    }
    await new Promise((r) => setTimeout(r, 10));
  }
}

function makeFakePrisma(args: {
  user?: { id: string; balance: unknown; playBalance: unknown } | null;
  historyBets?: any[];
  roundBets?: any[];
}) {
  const prisma = {
    user: {
      async findUnique(_q: any) {
        return args.user ?? null;
      },
    },
    bet: {
      async findMany(q: any) {
        if (q?.where?.roundId) {
          return args.roundBets ?? [];
        }
        return args.historyBets ?? [];
      },
    },
  };
  return prisma;
}

async function setupGateway(args: {
  allowedOrigin: string;
  gameState: FakeGameState | null;
  prisma: any;
  verifyToken?: (token: string) => Promise<string | null>;
  verifyTokenFromCookie?: (cookieHeader: string | undefined) => Promise<string | null>;
  heartbeatIntervalMs?: number;
  stateSync?: { replayCurrentRoundBets?: boolean; historyLimit?: number };
}) {
  const httpServer = createServer();

  const fakePriceService = new FakePriceService();
  const fakeGameEngine = new FakeGameEngine(args.gameState, { asset: 'BTCUSDT', bettingDuration: 5, maxDuration: 60 });

  const gateway = new WebSocketGateway(httpServer, {} as any, args.prisma as any, {
    cors: { origin: [args.allowedOrigin], credentials: true },
    heartbeat: { intervalMs: args.heartbeatIntervalMs ?? 50 },
    stateSync: args.stateSync,
    deps: {
      gameEngine: fakeGameEngine as any,
      priceService: fakePriceService as any,
      verifyToken:
        args.verifyToken ??
        (async () => {
          return null;
        }),
      verifyTokenFromCookie: async (socket) => {
        const cookie = socket.request.headers.cookie as string | undefined;
        return (args.verifyTokenFromCookie ?? (async () => null))(cookie);
      },
    },
  });

  await gateway.start();

  await new Promise<void>((resolve) => httpServer.listen(0, resolve));
  const address = httpServer.address();
  assert.ok(address && typeof address === 'object');
  const url = `http://localhost:${address.port}`;

  return { httpServer, url, gateway, fakeGameEngine, fakePriceService };
}

test('rejects disallowed origin', async (t) => {
  const { httpServer, url, gateway } = await setupGateway({
    allowedOrigin: 'http://allowed.local',
    gameState: null,
    prisma: makeFakePrisma({}),
  });

  t.after(async () => {
    await gateway.stop();
    await new Promise<void>((resolve) => httpServer.close(() => resolve()));
  });

  const socket = clientIo(url, {
    autoConnect: false,
    transports: ['websocket'],
    extraHeaders: { origin: 'http://bad.local' },
    reconnection: false,
    timeout: 1000,
  });

  t.after(() => socket.disconnect());

  const connectP = waitForEvent(socket, 'connect');
  const disconnectP = waitForEvent<string>(socket, 'disconnect');
  socket.connect();

  await connectP;
  const reason = await disconnectP;
  assert.equal(reason, 'io server disconnect');
  assert.equal(gateway.getStats().totalConnections, 0);
});

test('anonymous connection: allowed but read-only, receives snapshot + legacy init + ping/pong', async (t) => {
  const gameState: FakeGameState = {
    roundId: 'r1',
    status: 'RUNNING',
    asset: 'BTCUSDT',
    startPrice: 100,
    currentPrice: 101,
    currentRow: 6.4,
    elapsed: 1.5,
    roundStartTime: 1000,
  };

  const { httpServer, url, gateway } = await setupGateway({
    allowedOrigin: 'http://localhost:3000',
    gameState,
    prisma: makeFakePrisma({}),
  });

  t.after(async () => {
    await gateway.stop();
    await new Promise<void>((resolve) => httpServer.close(() => resolve()));
  });

  const socket = clientIo(url, {
    autoConnect: false,
    transports: ['websocket'],
    extraHeaders: { origin: 'http://localhost:3000' },
    reconnection: false,
  });
  t.after(() => socket.disconnect());

  const authP = waitForEvent<any>(socket, WS_EVENTS.AUTH_RESULT);
  const snapshotP = waitForEvent<any>(socket, WS_EVENTS.STATE_SNAPSHOT);
  const roundStartP = waitForEvent<any>(socket, WS_EVENTS.ROUND_START);
  const roundRunningP = waitForEvent<any>(socket, WS_EVENTS.ROUND_RUNNING);
  const stateUpdateP = waitForEvent<any>(socket, WS_EVENTS.STATE_UPDATE);

  socket.connect();

  const auth = await authP;
  assert.equal(auth.payload.success, true);
  assert.equal(auth.payload.userId, null);
  assert.equal(auth.payload.isAnonymous, true);

  const snapshot = await snapshotP;
  assert.equal(snapshot.type, WS_EVENTS.STATE_SNAPSHOT);
  assert.equal(snapshot.payload.isAuthenticated, false);
  assert.equal(snapshot.payload.userId, null);
  assert.equal(snapshot.payload.user, null);
  assert.equal(snapshot.payload.game.roundId, 'r1');

  // 
  const roundStart = await roundStartP;
  assert.equal(roundStart.payload.roundId, 'r1');
  const roundRunning = await roundRunningP;
  assert.equal(roundRunning.payload.roundId, 'r1');
  const stateUpdate = await stateUpdateP;
  assert.equal(stateUpdate.payload.currentRow, 6.4);

  // ping/pong
  const pongP = waitForEvent<any>(socket, WS_EVENTS.PONG);
  socket.emit(WS_EVENTS.PING);
  const pong = await pongP;
  assert.equal(typeof pong.timestamp, 'number');

  // read-only: place_bet rejected
  const rejectedP = waitForEvent<any>(socket, WS_EVENTS.BET_REJECTED);
  socket.emit(WS_EVENTS.PLACE_BET, {
    orderId: 'o1',
    amount: 1,
    targetRow: 6.5,
    targetTime: 2.1,
    isPlayMode: true,
  });
  const rejected = await rejectedP;
  assert.equal(rejected.payload.code, 'UNAUTHORIZED');

  assert.equal(gateway.getStats().authenticatedUsers, 0);
});

test('authenticated via cookie: receives snapshot with balances + history and replays current round bets', async (t) => {
  const gameState: FakeGameState = {
    roundId: 'r1',
    status: 'BETTING',
    asset: 'BTCUSDT',
    startPrice: 100,
    currentPrice: 100,
    currentRow: 6.5,
    elapsed: 0.2,
    roundStartTime: 1000,
  };

  const prisma = makeFakePrisma({
    user: { id: 'u1', balance: '10.50', playBalance: '20.25' },
    historyBets: [
      {
        id: 'hb1',
        orderId: 'h1',
        roundId: 'r0',
        amount: '2',
        multiplier: '1.5',
        targetRow: '6.5',
        targetTime: '1.1',
        rowIndex: 7,
        colIndex: 1,
        status: 'WON',
        isWin: true,
        payout: '3',
        isPlayMode: true,
        hitPrice: '50000.1',
        hitRow: '6.4',
        hitTime: '1.05',
        createdAt: new Date(1_000_000),
        settledAt: new Date(1_000_500),
      },
    ],
    roundBets: [
      {
        id: 'b1',
        orderId: 'o1',
        amount: '1',
        multiplier: '1.2',
        targetRow: '6.5',
        targetTime: '2.5',
        rowIndex: 6,
        colIndex: 3,
        status: 'PENDING',
        payout: '0',
        hitPrice: null,
        hitRow: null,
        hitTime: null,
        createdAt: new Date(2_000_000),
      },
      {
        id: 'b2',
        orderId: 'o2',
        amount: '1',
        multiplier: '1.2',
        targetRow: '6.5',
        targetTime: '2.6',
        rowIndex: 6,
        colIndex: 3,
        status: 'WON',
        payout: '2.4',
        hitPrice: '50000.2',
        hitRow: '6.3',
        hitTime: '2.55',
        createdAt: new Date(2_000_100),
      },
    ],
  });

  const { httpServer, url, gateway } = await setupGateway({
    allowedOrigin: 'http://localhost:3000',
    gameState,
    prisma,
    verifyTokenFromCookie: async (cookieHeader) => {
      return cookieHeader?.includes('next-auth.session-token=good') ? 'u1' : null;
    },
  });

  t.after(async () => {
    await gateway.stop();
    await new Promise<void>((resolve) => httpServer.close(() => resolve()));
  });

  const confirmed: any[] = [];
  const settled: any[] = [];

  const socket = clientIo(url, {
    autoConnect: false,
    transports: ['websocket'],
    extraHeaders: {
      origin: 'http://localhost:3000',
      cookie: 'next-auth.session-token=good',
    },
    reconnection: false,
  });
  t.after(() => socket.disconnect());

  socket.on(WS_EVENTS.BET_CONFIRMED, (msg) => confirmed.push(msg));
  socket.on(WS_EVENTS.BET_SETTLED, (msg) => settled.push(msg));

  const authP = waitForEvent<any>(socket, WS_EVENTS.AUTH_RESULT);
  const snapshotP = waitForEvent<any>(socket, WS_EVENTS.STATE_SNAPSHOT);
  socket.connect();

  const auth = await authP;
  assert.equal(auth.payload.success, true);
  assert.equal(auth.payload.userId, 'u1');

  const snapshot = await snapshotP;
  assert.equal(snapshot.payload.isAuthenticated, true);
  assert.equal(snapshot.payload.userId, 'u1');
  assert.equal(snapshot.payload.user.balance, 10.5);
  assert.equal(snapshot.payload.user.playBalance, 20.25);
  assert.equal(snapshot.payload.user.recentBets.length, 1);

  await waitUntil(() => confirmed.length === 2 && settled.length === 1);
  assert.deepEqual(
    confirmed.map((m) => m.payload.orderId),
    ['o1', 'o2']
  );
  assert.equal(settled[0].payload.orderId, 'o2');

  assert.equal(gateway.getStats().authenticatedUsers, 1);
});

test('auth upgrade via WS auth: enables betting and forwards bet_confirmed', async (t) => {
  const gameState: FakeGameState = {
    roundId: 'r1',
    status: 'RUNNING',
    asset: 'BTCUSDT',
    startPrice: 100,
    currentPrice: 101,
    currentRow: 6.4,
    elapsed: 1.5,
    roundStartTime: 1000,
  };

  const { httpServer, url, gateway, fakeGameEngine } = await setupGateway({
    allowedOrigin: 'http://localhost:3000',
    gameState,
    prisma: makeFakePrisma({ user: { id: 'u1', balance: 1, playBalance: 2 } }),
    verifyToken: async (token) => (token === 'good' ? 'u1' : null),
  });

  t.after(async () => {
    await gateway.stop();
    await new Promise<void>((resolve) => httpServer.close(() => resolve()));
  });

  const socket = clientIo(url, {
    autoConnect: false,
    transports: ['websocket'],
    extraHeaders: { origin: 'http://localhost:3000' },
    reconnection: false,
  });
  t.after(() => socket.disconnect());

  const anonAuthP = waitForEvent<any>(socket, WS_EVENTS.AUTH_RESULT);
  socket.connect();
  await anonAuthP;

  const authP = waitForEvent<any>(socket, WS_EVENTS.AUTH_RESULT);
  socket.emit(WS_EVENTS.AUTH, { token: 'good' });
  const auth = await authP;
  assert.equal(auth.payload.success, true);
  assert.equal(auth.payload.userId, 'u1');

  const betConfirmedP = waitForEvent<any>(socket, WS_EVENTS.BET_CONFIRMED);
  socket.emit(WS_EVENTS.PLACE_BET, { orderId: 'o9', amount: 1, targetRow: 6.5, targetTime: 2.1, isPlayMode: true });
  const confirmed = await betConfirmedP;
  assert.equal(confirmed.payload.orderId, 'o9');
  assert.equal(fakeGameEngine.placeBetCalls.length, 1);
  assert.equal(fakeGameEngine.placeBetCalls[0]?.userId, 'u1');
});

/**
 * WebSocket Gateway - 
 */

import { Server as SocketIOServer, Socket } from 'socket.io';
import type { Server as HTTPServer } from 'http';
import type { Redis } from 'ioredis';
import type { PrismaClient } from '@prisma/client';
import { WS_EVENTS, ERROR_CODES } from './constants';
import type { PlaceBetRequest, GameStateSnapshot, StateSnapshotMessage, UserStateSnapshot } from './types';
import { GameError } from './errors';

export interface WSGatewayConfig {
  cors?: {
    origin: string | string[];
    credentials?: boolean;
  };
  heartbeat?: {
    /**
     *  PONG ms/
     *  25000ms
     */
    intervalMs?: number;
  };
  stateSync?: {
    /**
     *  Round 
     *  true
     */
    replayCurrentRoundBets?: boolean;
    /**
     *  20
     */
    historyLimit?: number;
  };
  deps?: {
    gameEngine?: GameEnginePort;
    priceService?: PriceServicePort;
    verifyToken?: (token: string) => Promise<string | null>;
    verifyTokenFromCookie?: (socket: AuthenticatedSocket) => Promise<string | null>;
  };
}

export interface AuthenticatedSocket extends Socket {
  userId?: string;
  isAuthenticated?: boolean;
}

export interface GameEnginePort {
  getState: () => any;
  getConfig: () => any;
  placeBet: (userId: string, request: PlaceBetRequest) => Promise<unknown>;
  stop: () => Promise<void>;
  removeAllListeners: (event?: string) => unknown;
  on: (event: string, listener: (...args: any[]) => void) => unknown;
}

export interface PriceServicePort {
  start: () => Promise<void>;
  stop: () => Promise<void>;
  removeAllListeners: (event?: string) => unknown;
  on: (event: string, listener: (...args: any[]) => void) => unknown;
  off?: (event: string, listener: (...args: any[]) => void) => unknown;
}

export class WebSocketGateway {
  private io: SocketIOServer;
  private gameEngine: GameEnginePort | null;
  private priceService: PriceServicePort | null;
  private connectedUsers: Map<string, Set<string>> = new Map(); // userId -> socketIds
  private allowedOrigins: Set<string>;
  private readonly heartbeatIntervalMs: number;
  private readonly replayCurrentRoundBets: boolean;
  private readonly historyLimit: number;
  private readonly verifyToken: (token: string) => Promise<string | null>;
  private readonly verifyTokenFromCookie: (socket: AuthenticatedSocket) => Promise<string | null>;
  private readonly socketHeartbeatTimers: Map<string, ReturnType<typeof setInterval>> = new Map();
  private gameEngineListenersReady = false;

  constructor(
    httpServer: HTTPServer,
    private redis: Redis,
    private prisma: PrismaClient,
    config?: WSGatewayConfig
  ) {
    //  AUTH_SECRET ( NEXTAUTH_SECRET)
    const authSecret = process.env.AUTH_SECRET || process.env.NEXTAUTH_SECRET;
    if (!authSecret) {
      console.warn('[WSGateway] AUTH_SECRET not configured - authentication will fail');
    }

    //  Socket.IO
    const normalizeOrigin = (origin: string) => origin.trim().replace(/\/$/, '').toLowerCase();
    const rawCorsOrigin = config?.cors?.origin ?? process.env.WS_CORS_ORIGIN?.split(',') ?? ['http://localhost:3000'];
    const corsOrigin = (Array.isArray(rawCorsOrigin) ? rawCorsOrigin : [rawCorsOrigin])
      .map(normalizeOrigin)
      .filter(Boolean);

    this.allowedOrigins = new Set(corsOrigin);

    const cors = config?.cors
      ? { ...config.cors, origin: corsOrigin }
      : {
        origin: corsOrigin,
        credentials: true,
      };
    this.io = new SocketIOServer(httpServer, {
      cors,
      transports: ['websocket', 'polling'],
    });

    this.heartbeatIntervalMs = Math.max(1000, config?.heartbeat?.intervalMs ?? 25_000);
    this.replayCurrentRoundBets = config?.stateSync?.replayCurrentRoundBets ?? true;
    this.historyLimit = Math.max(0, Math.min(200, config?.stateSync?.historyLimit ?? 20));

    this.gameEngine = config?.deps?.gameEngine ?? null;
    this.priceService = config?.deps?.priceService ?? null;

    this.verifyToken =
      config?.deps?.verifyToken ??
      (async (token: string) => {
        const { verifyNextAuthToken } = await import('./wsAuth');
        return verifyNextAuthToken({ token, prisma: this.prisma });
      });

    this.verifyTokenFromCookie =
      config?.deps?.verifyTokenFromCookie ??
      (async (socket: AuthenticatedSocket) => {
        const { verifyNextAuthCookie } = await import('./wsAuth');
        return verifyNextAuthCookie({ req: socket.request as any, prisma: this.prisma });
      });

    this.setupEventHandlers();
  }

  /**
   * 
   */
  async start(): Promise<void> {
    await this.ensureServicesReady();
    await this.priceService!.start();
    console.log('[WSGateway] Started');
  }

  /**
   * 
   */
  async stop(): Promise<void> {
    for (const timer of this.socketHeartbeatTimers.values()) {
      clearInterval(timer);
    }
    this.socketHeartbeatTimers.clear();

    if (this.gameEngine) {
      await this.gameEngine.stop();
      this.gameEngine.removeAllListeners();
    }
    if (this.priceService) {
      await this.priceService.stop();
      this.priceService.removeAllListeners();
    }
    this.io.close();
    console.log('[WSGateway] Stopped');
  }

  /**
   *  GameEngine 
   */
  getGameEngine(): import('./GameEngine').GameEngine {
    if (!this.gameEngine) {
      throw new Error('GameEngine not initialized. Did you forget to call gateway.start()?');
    }
    return this.gameEngine as unknown as import('./GameEngine').GameEngine;
  }

  /**
   *  PriceService 
   */
  getPriceService(): import('./PriceService').PriceService {
    if (!this.priceService) {
      throw new Error('PriceService not initialized. Did you forget to call gateway.start()?');
    }
    return this.priceService as unknown as import('./PriceService').PriceService;
  }

  private async ensureServicesReady(): Promise<void> {
    if (!this.priceService) {
      const { PriceService } = await import('./PriceService');
      this.priceService = new PriceService(
        {
          asset: 'BTC',
          allowStartWithoutConnection: true,
        },
        this.redis
      ) as unknown as PriceServicePort;
    }

    if (!this.gameEngine) {
      const { GameEngine } = await import('./GameEngine');
      this.gameEngine = new GameEngine(this.redis, this.prisma, this.priceService as any) as unknown as GameEnginePort;
    }

    if (!this.gameEngineListenersReady) {
      this.setupGameEngineListeners();
      this.gameEngineListenersReady = true;
    }
  }

  private isOriginAllowed(socket: AuthenticatedSocket): boolean {
    const originHeader = socket.handshake?.headers?.origin ?? socket.request?.headers?.origin;
    const origin = Array.isArray(originHeader) ? originHeader[0] : originHeader;
    if (!origin || typeof origin !== 'string') return false;

    const normalizedOrigin = origin.trim().replace(/\/$/, '').toLowerCase();
    if (this.allowedOrigins.has('*')) return true;
    return this.allowedOrigins.has(normalizedOrigin);
  }

  /**
   *  Socket 
   */
  private setupEventHandlers(): void {
    this.io.on('connection', async (socket: AuthenticatedSocket) => {
      if (!this.isOriginAllowed(socket)) {
        const originHeader = socket.handshake?.headers?.origin ?? socket.request?.headers?.origin;
        const origin = Array.isArray(originHeader) ? originHeader[0] : originHeader;
        console.warn(`[WSGateway] Rejected connection from origin: ${origin ?? 'unknown'}`);
        socket.disconnect(true);
        return;
      }

      console.log(`[WSGateway] Client connected: ${socket.id}`);

      this.registerSocketHandlers(socket);

      //  Cookie 
      await this.handleAutoAuth(socket);

      // 
      void this.syncStateForSocket(socket, { reason: 'connect' }).catch((error) => {
        console.error('[WSGateway] Failed to sync state after connect:', error);
      });
    });
  }

  private registerSocketHandlers(socket: AuthenticatedSocket): void {
    //  PONG ping
    const timer = setInterval(() => {
      if (socket.connected) {
        socket.emit(WS_EVENTS.PONG, { timestamp: Date.now() });
      }
    }, this.heartbeatIntervalMs);
    this.socketHeartbeatTimers.set(socket.id, timer);

    // ping -> pong
    socket.on(WS_EVENTS.PING, () => {
      socket.emit(WS_EVENTS.PONG, { timestamp: Date.now() });
    });

    //  Cookie 
    socket.on(WS_EVENTS.AUTH, (data: { token: string }) => {
      void this.handleAuth(socket, data).catch((error) => {
        console.error('[WSGateway] Unhandled error in auth handler:', error);
      });
    });

    // /
    socket.on(
      WS_EVENTS.STATE_REQUEST,
      (payload?: { includeHistory?: boolean; historyLimit?: number }) => {
        void this.syncStateForSocket(socket, {
          reason: 'state_request',
          includeHistory: payload?.includeHistory,
          historyLimit: payload?.historyLimit,
        }).catch((error) => {
          console.error('[WSGateway] Failed to sync state after state_request:', error);
        });
      }
    );

    //  -  Promise 
    socket.on(WS_EVENTS.PLACE_BET, (data) => {
      void this.handlePlaceBet(socket, data as PlaceBetRequest).catch((error) => {
        console.error('[WSGateway] Unhandled error in place_bet handler:', error);
        socket.emit(WS_EVENTS.BET_REJECTED, {
          type: WS_EVENTS.BET_REJECTED,
          payload: {
            orderId: (data as any)?.orderId ?? 'unknown',
            code: 'INTERNAL_ERROR',
            message: '',
          },
          timestamp: Date.now(),
        });
      });
    });

    // 
    socket.on('disconnect', () => this.handleDisconnect(socket));
  }

  private async syncStateForSocket(
    socket: AuthenticatedSocket,
    options: { reason: 'connect' | 'auth' | 'state_request'; includeHistory?: boolean; historyLimit?: number }
  ): Promise<void> {
    const game = this.buildGameStateSnapshot();
    const includeHistory = options.includeHistory ?? true;
    const historyLimit = options.historyLimit ?? this.historyLimit;

    const user =
      socket.isAuthenticated && socket.userId
        ? await this.buildUserStateSnapshot(socket.userId, { includeHistory, historyLimit })
        : null;

    const message: StateSnapshotMessage = {
      type: WS_EVENTS.STATE_SNAPSHOT,
      payload: {
        serverTime: Date.now(),
        connectionId: socket.id,
        isAuthenticated: Boolean(socket.isAuthenticated && socket.userId),
        userId: socket.userId ?? null,
        game,
        user,
      },
      timestamp: Date.now(),
    };

    socket.emit(WS_EVENTS.STATE_SNAPSHOT, message);

    // / Round 
    this.emitLegacyGameSnapshot(socket, game);

    //  Round  activeBets
    if (this.replayCurrentRoundBets && socket.isAuthenticated && socket.userId && game.roundId) {
      await this.replayCurrentRoundBetEvents(socket, socket.userId, game.roundId);
    }
  }

  private buildGameStateSnapshot(): GameStateSnapshot {
    const config = this.gameEngine?.getConfig?.() ?? { asset: 'BTCUSDT', bettingDuration: 5, maxDuration: 60 };
    const state = this.gameEngine?.getState?.() ?? null;

    if (!state) {
      return {
        roundId: null,
        status: null,
        asset: config.asset ?? 'BTCUSDT',
        startPrice: 0,
        currentPrice: 0,
        currentRow: 6.5,
        elapsed: 0,
        startTime: 0,
        bettingDuration: this.toNumber(config.bettingDuration, 5),
        maxDuration: this.toNumber(config.maxDuration, 60),
      };
    }

    return {
      roundId: state.roundId ?? null,
      status: state.status ?? null,
      asset: state.asset ?? config.asset ?? 'BTCUSDT',
      startPrice: this.toNumber(state.startPrice, 0),
      currentPrice: this.toNumber(state.currentPrice, 0),
      currentRow: this.toNumber(state.currentRow, 6.5),
      elapsed: this.toNumber(state.elapsed, 0),
