  private setupGameEngineListeners(): void {
    if (!this.gameEngine || !this.priceService) {
      return;
    }

    // 
    this.gameEngine.on('round:start', (data) => {
      this.io.emit(WS_EVENTS.ROUND_START, {
        type: WS_EVENTS.ROUND_START,
        payload: data,
        timestamp: Date.now(),
      });
    });

    // 
