      this.io.emit(WS_EVENTS.ROUND_RUNNING, {
        type: WS_EVENTS.ROUND_RUNNING,
        payload: data,
        timestamp: Date.now(),
      });
    });

    // 
    this.gameEngine.on('round:end', (data) => {
      this.io.emit(WS_EVENTS.ROUND_END, {
        type: WS_EVENTS.ROUND_END,
        payload: data,
        timestamp: Date.now(),
      });
    });

    // 
    this.gameEngine.on('round:cancelled', (data) => {
