    this.gameEngine.on('state:update', (data) => {
      this.io.emit(WS_EVENTS.STATE_UPDATE, {
        type: WS_EVENTS.STATE_UPDATE,
        payload: data,
        timestamp: Date.now(),
      });
    });

    // 
    this.gameEngine.on('bet:confirmed', (data) => {
      if (data.userId.startsWith('anon-')) {
